import React from 'react';
import Form from './components/Form';
import Todo from './components/Todo';
// import logo from './logo.svg';
import './App.css';

interface Props {
  text: string;
}

const App: React.FC = () => {
  return (
    <div>
      <Form />
      <ul>
        <li>
          <Todo text="hogehoge" />
        </li>
      </ul>
    </div>
  );
}

export default App;
